import logoImg from "src/assets/images/logo/logo.svg";
import "./Header.css";
function Header() {
  return (
    <header>
      <img src={logoImg} alt="logo" href="/" />
      <p>
        <a href="/">자유게시판</a>
      </p>
      <p>
        <a href="/items.html">중고마켓</a>
      </p>
    </header>
  );
}
export default Header;
